    [],nt"revision_timestamp": "2016-07-27T23:04:44.035455",nt"name": "waterfowl-production-and-habitat-survey",nt"isopen":
    false,nt"url": null,nt"notes": "The Waterfowl Production and Habitat Survey,
    conducted by the U.S. Fish and Wildlife Service, became operational in 1955 in the
    Canadian prairies (strata 26-40). In the north-central United States strata were
    phased in during 1958 (strata 43, 45-47), 1959 (strata 44, 48-49), and 1966 (strata
    41-42). In Canadau2019s Northwest Territories and northern Alberta, strata (13-18,75-77)
    have been surveyed since 1966. The primary purpose of the survey was to provide
    information on duck production from the mid-continent breeding areas. These data
    were used in the past to forecast the annual fall flight of ducks. Present applications
    include research on habitat, climate, and waterfowl production relationships important
    in harvest regulation and habitat conservation.  Since 2004, the USFWS has not had
    the traditional Waterfowl Production and Habitat Survey to verify the early predictions
    of our biologists in the field. The production survey was discontinued due to budget
    constraints within the migratory bird program and because modern analytical procedures
    reduced the utility of brood indices produced by the survey.  Instead, the USFWS
    presents habitat conditions as recorded during the months of May and June at the
    time of the Waterfowl Breeding Population and Habitat Survey within the Waterfowl
    Population Status reports located on the following website, http://www.fws.gov/birds/surveys-and-data/reports-and-publications/population-status.php.",nt"license_title":
